import React from 'react';
import Avatar from '@material-ui/core/Avatar';
import Button from '@material-ui/core/Button';
import CssBaseline from '@material-ui/core/CssBaseline';
import TextField from '@material-ui/core/TextField';
import FormControlLabel from '@material-ui/core/FormControlLabel';
import Checkbox from '@material-ui/core/Checkbox';
import Link from '@material-ui/core/Link';
import Grid from '@material-ui/core/Grid';
import Box from '@material-ui/core/Box';
// import LockOutlinedIcon from '@material-ui/icons/LockOutlined';
import Typography from '@material-ui/core/Typography';
import { makeStyles } from '@material-ui/core/styles';
import Container from '@material-ui/core/Container';
import TextInpunts from "../components/textInput";
import Buttons from "../components/button";
import FormconrrllCheckbox from "../components/formcontrollcheckbox";
import RadioForcontroll from "../components/radioformcontrol";
import Card from '@material-ui/core/Card';

function Copyright() {
  return (
    <Typography variant="body2" color="textSecondary" align="center">
      {'Copyright © '}
      <Link color="inherit" href="https://material-ui.com/">
        Your Website
      </Link>{' '}
      {new Date().getFullYear()}
      {'.'}
    </Typography>
  );
}

const useStyles = makeStyles((theme) => ({
  paper: {
    marginTop: theme.spacing(8),
    display: 'flex',
    flexDirection: 'column',
    alignItems: 'center',
  },
  avatar: {
    margin: theme.spacing(1),
    backgroundColor: theme.palette.secondary.main,
  },
  form: {
    width: '100%', // Fix IE 11 issue.
    marginTop: theme.spacing(1),
  },
  submit: {
    margin: theme.spacing(3, 0, 2),
  },
}));

export default function SignIn() {
  const classes = useStyles();

  return (
    <Container component="main" maxWidth="sm">
       <Card className={classes.root} style={{padding: 18}}>
      <CssBaseline />
      <div className={classes.paper}>

        <Typography component="h1" variant="h5" >
        <span style={{color:'#121858', fontWeight: 'bold'}}> Student Data Form</span>  
        </Typography>

        <form className={classes.form} noValidate>
          <TextInpunts
           id="fname"
           text={"First Name"}
           name="fname" 
           />
          <TextInpunts
           id="lname"
           text={"Last Name"}
           name="lname" 
           />
          <TextInpunts
            id="email"
            text={"Email Address"}
            name="email"
            autoComplete="email"
            autoFocus
          />
          <TextInpunts
            id="mobile"
            text={"Mobile Number"}
            name="mobile"
            autoComplete="mobile"
            autoFocus
          />
          <TextInpunts
            name="password"
            text="Password"
            type="password"
            id="password"
            autoComplete="current-password"
          />
          <FormconrrllCheckbox  val={"hiiiii"} labeltext={"English"}/>
          <RadioForcontroll />
          <Buttons  type="submit" name={"Submit"} className={classes.submit} />
        </form>
      </div>
      </Card>
    </Container>
  );
}
